import logo from './logo.svg';
import './App.css';
import HeaderComponent from './Header';
import InputComponent from './Input';
import ButtonComponent from './Button';

function App() {
  return (
    <div>
      <HeaderComponent tag = "h1" text="What's the Plan for Today?"/>
      <center>
        <InputComponent placeholder = "Enter some plan" />
        <ButtonComponent text = "Add" color="green"/>
      </center>
    </div>
  );
}

export default App;
